import axios from 'axios';
import * as React from 'react';
import * as SplashScreen from 'expo-splash-screen';
import * as Font from 'expo-font';
import AppLoading from 'expo-app-loading';
import {NavigationContainer} from '@react-navigation/native';
import {createNativeStackNavigator} from '@react-navigation/native-stack';
import PrimeraPantalla from './screens/PrimeraPantalla';
import LocalizarDEA from './screens/LocalizarDEA';

axios.defaults.baseURL = 'http://localhost:3000';

const Stack = createNativeStackNavigator();

const App = () => {
  const CustomFonts = {
    'CustomFont-Regular': require('../fonts/CustomFont-Regular.ttf'),
    'CustomFont-Bold': require('../fonts/CustomFont-Bold.ttf'),
    'CustomFont-Italic': require('../fonts/CustomFont-Italic.ttf'),
  };

  async function componentDidMount() {
    await Font.loadAsync(CustomFonts);
  }

  useEffect(() => componentDidMount(), []);
  return (
    <NavigationContainer>
      <Stack.Navigator style={{fontFamily: 'Poppins'}} screenOptions={{headerShown: false}}>
        <Stack.Screen name="Index" component={PrimeraPantalla} />
        <Stack.Screen name="Home" component={LocalizarDEA} />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

export default App;
